import React from 'react';

const reportblock = {
    backgroundColor: "whitesmoke",
    borderRadius: "50px",
    display: "block",
    width: "5000px",
    height: "600px",
    textAlign: "center",
    marginLeft: "185px",
    marginTop: "20px",
    alignContent: "center"
}

export const NewReport = (props) => (
    <reportblock> Generate a New Report </reportblock>
)
